import * as collect from './collect';
import { logE } from '@wanwu/base-logger';
export function logPackage() {
    const domComplete = collect.getDomCompleteTime();
    const timeoutRes = JSON.stringify(collect.getTimeoutRes());
    const bigRes = JSON.stringify(collect.getBigResource());
    const dnsTime = collect.getDnsTime();
    const connectionTime = collect.getConnectionTime();
    const responseTime = collect.getResponseTime();
    const downloadTime = collect.getDownloadTime();
    const resourceNum = collect.getResourceNum();
    const TTFB = collect.getTTFB();
    const memory = JSON.stringify(collect.getMemory());
    // 上报页面加载时间
    logE(20005, { domComplete, timeoutRes, bigRes, resourceNum, dnsTime, connectionTime, responseTime, downloadTime, TTFB, memory });
}
